import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for the featured products grid by ID (different selector)
    await page.waitForSelector('#productsGrid', { timeout: 5000 });

    // Find the first product card using a CSS selector for .product-card
    const productCards = await page.$$('.product-card');
    if (!productCards.length) throw new Error('No product cards found');

    // Click the first product card to open the product detail modal
    await productCards[0].click();

    // Wait for the product modal to appear (by ID)
    await page.waitForSelector('#productModal', { timeout: 5000 });

    // Wait for the "Add to Wish List" button using button text (different selector strategy)
    const addToWishlistBtn = await page.waitForSelector(
      '//button[contains(., "Add to Wish List")]',
      { timeout: 5000 }
    );

    // Take screenshot before clicking wishlist
    const step2 = path.join(screenshotsDir, 'step_2_product_modal.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Click the "Add to Wish List" button
    await addToWishlistBtn.click();

    // Wait for the notification to appear using its class (different selector)
    const notification = await page.waitForSelector('.notification.success', { timeout: 5000 });

    // Take screenshot after adding to wishlist
    const step3 = path.join(screenshotsDir, 'step_3_after_add_wishlist.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Extract notification text to verify
    const notificationText = await notification.textContent();

    // Open the wishlist page by clicking the "Your Wish List" link (use nth occurrence to avoid header/footer duplicates)
    const wishlistLinks = await page.$$('a');
    let wishlistLink = null;
    for (const link of wishlistLinks) {
      const text = (await link.textContent())?.trim();
      if (text === 'Your Wish List') {
        wishlistLink = link;
        break;
      }
    }
    if (!wishlistLink) throw new Error('Could not find "Your Wish List" link');
    await wishlistLink.click();

    // Wait for the wishlist page to load (wait for .wishlist-page)
    await page.waitForSelector('.wishlist-page', { timeout: 5000 });

    // Take screenshot of wishlist page
    const step4 = path.join(screenshotsDir, 'step_4_wishlist_page.png');
    await page.screenshot({ path: step4 });
    screenshots.push(step4);

    // Extract the titles of wishlist items
    const wishlistTitles = await page.$$eval('.wishlist-title', nodes => nodes.map(n => n.textContent.trim()));

    return {
      success: true,
      action: "Added first product to wishlist and verified wishlist page",
      extractedData: {
        notificationText,
        wishlistTitles
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
